o-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:\"Times\",\"serif\";\r\n	mso-bidi-font-family:\"Times New Roman\";}\r\n</style>\r\n<![endif]-->\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-left:.5in;text-align:left\" align=\"left\"><span style=\"mso-bidi-font-size:14.0pt;font-family:\" garamond\",\"serif\";color:black\"=\"\">Project\r\nManagement is important as all the software projects have risks. The root cause\r\nfor project failure is a business as opposed to a technical failure. Getting\r\nany group of powerful individuals (stakeholders) to agree to and then maintain\r\na project for any extended period of time is very difficult. The developers,\r\nclients, suppliers, support personnel, distributors, and potential users are\r\njust a sampling of stakeholders. In order to deliver a right project all these\r\nstakeholders must be aligned.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.5in\" align=\"left\"><span style=\"mso-bidi-font-size:\r\n14.0pt;font-family:\" garamond\",\"serif\";color:black\"=\"\">Many projects fail due to\r\nconcerns about cost, schedule, and the degree to which the solution will\r\ndeliver what was promised. Project manager is responsible for getting together\r\nthe people involved in developing a project.</span></p><p class=\"MsoNormal\" style=\"margin-left:.5in\" align=\"left\"><img alt=\"\" src=\"http://www.jodypaul.com/swe/lcm/waterfall.gif\" border=\"0\" vspace=\"\" hspace=\"\"><br><span style=\"mso-bidi-font-size:\r\n14.0pt;font-family:\" garamond\",\"serif\";color:black\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-left:.5in\" align=\"left\"><span style=\"mso-bidi-font-size:\r\n14.0pt;font-family:\" garamond\",\"serif\";color:black\"=\"\"><br></span></p>\r\n\r\n       '),('12346','2012-08-13','<ul style=\"margin-top:0in\" type=\"disc\"><li class=\"MsoNormal\" style=\"color:black;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;\r\n     mso-bidi-font-size:14.0pt;font-family:\" garamond\",\"serif\";mso-fareast-font-family:=\"\" times\"=\"\">Designers goal is to establish how the application interacts with\r\n     its environment. Once the context is understood, designers must create\r\n     useful patterns of interaction. Design occurs at numerous levels</span></li><li class=\"MsoNormal\" style=\"color:black;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;\r\n     mso-bidi-font-size:14.0pt;font-family:\" garamond\",\"serif\";mso-fareast-font-family:=\"\" times\"=\"\">Top Level Design: How is the business work partitioned across\r\n     resources and how it is spread over time</span></li><li class=\"MsoNormal\" style=\"color:black;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;\r\n     mso-bidi-font-size:14.0pt;font-family:\" garamond\",\"serif\";mso-fareast-font-family:=\"\" times\"=\"\">High-level Design: How are the functions and features of the\r\n     application spread out over various computing resources and modules</span></li><li class=\"MsoNormal\" style=\"color:black;margin-bottom:0in;margin-bottom:.0001pt;\r\n     line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;\r\n     mso-bidi-font-size:14.0pt;font-family:\" garamond\",\"serif\";mso-fareast-font-family:=\"\" times\"=\"\">Detailed Design: Which algorithms and coding options best\r\n     implements a module in context</span></li></ul>\r\n\r\n  '),('12347','2012-08-13','<!--[if gte mso 9]><xml>\r\n <o:DocumentProperties>\r\n  <o:Version>14.00</o:Version>\r\n </o:DocumentProperties>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSet